import { useState, useEffect } from 'react';
import { getStudents, createStudent } from '../../utils/student';


export default function StudentsPage(props) {
    const [firstName, setFirstName] = useState("");
    const [familyName, setFamilyName] = useState("");
    const [dateOfBirth, setDateOfBirth] = useState(Date(Date.now()));
    const [students, setStudents] = useState([]);
    const [error, setError] = useState(false);

    useEffect(() => {
        getAll()
    }, [])
        async function getAll() {
            const studentAll = await getStudents()
            setStudents(studentsAll)
            console.log(studentsAll)

    }

//     function handleChange(e) {
//     if (e.target.name === "firstName") setFirstName(e.target.value);
//     if (e.target.name === "familyName") setFamilyName(e.target.value);
//     if (e.target.name === "dateOfBirth") setDateOfBirth(e.target.value);
// }

async function handleSubmit(e) {
    e.preventDefault()
    setFirstName("")
    setFamilyName("")
    setDateOfBirth("")
    if (firstName.length === 0 || familyName.length === 0) {
      setError(true)
    }

    function calculateAge(birthday) { // birthday is a date
      birthday = new Date(birthday)
      var ageDifMs = Date.now() - birthday;
      var ageDate = new Date(ageDifMs); // miliseconds from epoch
      return Math.abs(ageDate.getUTCFullYear() - 1970);
  }

    if (firstName && familyName && calculateAge(dateOfBirth) > 10) {
        let body = {
            firstName: props.firstName,
            familyName: props.familyName,
            dateOfBirth: props.dateOfBirth,
          };
      createStudent(body)
      .then((error) => {
        alert("New student has been added")
    })
    setFirstName("")
    setFamilyName("")
    setDateOfBirth("")
    getStudents()

    } else if (dateOfBirth && calculateAge(dateOfBirth) > 10) {
      setError(true);
      alert("Student must be at least 10 years old");
    }
  }
    return(
        <>

    <form>
        <div>
          <span>First name</span><br/>
          <input name="firstName"  onChange={e=>setFirstName(e.target.value)} required />
        </div>

        <div>
          <span>Family name</span><br/>
          <input name="familyName" value={props.familyName} onChange={e=>setFamilyName(e.target.value)} required />
        </div>

          <div>
          <span>Date of birth</span><br/>
          <input name="dateOfBirth" type="date" value={props.dateOfBirth} onChange={e=>setDateOfBirth(e.target.value)} required />
          </div>
          <br/>
          {error ?
          <label>All fields must be filled</label> : ""}
          <br/>
          <button onClick={handleSubmit}>Submit</button>
    </form>
    <div className='Student'>
    <table className='table'>
        <thead>
            <tr>
        <th>First Name</th>
        <th>Family Name</th>
        <th>Date of Birth</th>

            </tr>
        </thead>
        {/* <tbody>
            <tr>
    <td className="Student-firstName">{props.firstName}</td>
    <td className="Student-familyName">{props.familyName}</td>
    <td className="Student-dateOfBirth">{props.dateOfBirth}</td>
            </tr>
        </tbody> */}
          <tbody>
            {students.map((s) => {
              return (
                <tr key={s._id}>
                  <td>{s.firstName}</td>
                  <td>{s.familyName}</td>
                  <td>{s.dateOfBirth}</td>
                </tr>
              );
            })}
          </tbody>
    </table>
</div>
</>
  )


}
